function proManage(str,actn)
{	
	let isCheckUrl=isCheck('base_url')+'member/profile/edit';
	if(actn=='personalInfo')
	{
		let msg='';
	if(str=='1')
	{
		msg="'personalInfo'";
		if(!isCheck('pNameE')){toast('tst_danger','Please enter your name'); point('pNameE');}
		else if(!isCheck('genderE')){toast('tst_danger','Please select your gender');}
		else if(!isCheck('mobileE')){toast('tst_danger','Please enter your mobile number'); point('mobileE');}
		else if(!isCheck('emailTE')){toast('tst_danger','Please enter your enter your email id'); point('emailTE');}
		else if(!isCheck('dobE')){toast('tst_danger','Please enter your enter your date of birth'); point('dobE');}
		else if(!isCheck('aadharE')){toast('tst_danger','Please enter your enter your aadhaar number'); point('aadharE');}
		else if(!isCheck('addrrE')){toast('tst_danger','Please enter your enter your address'); point('addrrE');}
		else if(!isCheck('zipcodeE')){toast('tst_danger','Please enter your enter your zipcode'); point('zipcodeE');}
		else if(!isCheck('statN')){toast('tst_danger','Please select your state'); }else if(!isCheck('district')){toast('tst_danger','Please select you district'); }
		else if(!isCheck('panE')){toast('tst_danger','Please enter your enter your pan number'); point('panE');}
else{
		$('#prInf').html('<button class="edtBtn btnIncR"><i class="bx bx-cog bx-spin"></i> Wait...</button>');
		$.post(isCheckUrl,
			{pNameE:isCheck('pNameE'),genderE:isCheck('genderE'),mobileE:isCheck('mobileE'),emailTE:isCheck('emailTE'),dobE:isCheck('dobE'),aadharE:isCheck('aadharE'),
			addrrE:isCheck('addrrE'),zipcodeE:isCheck('zipcodeE'),stateE:isCheck('statN'),districtE:isCheck('district'),panE:isCheck('panE'),actn:'prInfo'},
			function(html){	toast(html.class,html.text);
			if(html.class=='tst_success')
			{
				$('#genderT').hide();$('#gender').show();$('#pName').html($('#pNameE').val());$('#gender').html($('#genderE').val());$('#mobile').html($('#mobileE').val());
				$('#emailT').html($('#emailTE').val());$('#dob').html($('#dobE').val());$('#aadhar').html($('#aadharE').val());$('#pan').html($('#panE').val());
				$('#addrr').html($('#addrrE').val());$('#zipcode').html($('#zipcodeE').val());$('#state').show();$('#stateE').hide();$('#districtE').hide();$('#distrt').show();
				$('#prInf').html('<button class="edtBtn btnIncR" onclick="proManage(2,'+msg+')"><i class="mdi mdi-comment-edit-outline"></i> Edit</button>');
					}
			},'json');
	}
		}
		else if(str=='2')
		{
			msg="'personalInfo'";$('#pName').html(gethtmlTools('pNameE',$('#pName').text()));$('#pan').html(gethtmlTools('panE',$('#pan').text()));$('#panE').addClass('mblW');
			$('#gender').hide();$('#genderT').show();$('#mobile').html(gethtmlTools('mobileE',$('#mobile').text()));$('#mobileE').addClass('mblW');
			$('#emailT').html(gethtmlTools('emailTE',$('#emailT').text()));$('#emailTE').css('width','60%');$('#dob').html(gethtmlTools('dobE',$('#dob_t').val()));
			$('#dobE').attr('type', 'date').css('width','60%');$('#aadhar').html(gethtmlTools('aadharE',$('#aadhar').text()));$('#aadharE').addClass('mblW');
			$('#addrr').html(gethtmlTools('addrrE',$('#addrr').text()));$('#zipcode').html(gethtmlTools('zipcodeE',$('#zipcode').text()));$('#zipcodeE').addClass('mblW');
			$('#state').hide();$('#stateE').show();$('#distrt').hide();$('#districtE').show();
			$('#prInf').html('<button class="updtBtn btnIncR" onclick="proManage(1,'+msg+')"><i class="mdi mdi-comment-edit-outline"></i> Update</button>');
			}		
	}	
	else if(actn=='bankingInfor')
	{
		let msg='';
		
		if(str=='1')
		{
			msg="'bankingInfor'";
			if(!isCheck('bNameE')){toast('tst_danger','Please enter your bank name'); point('bNameE');}
			else if(!isCheck('acNumberE')){toast('tst_danger','Please enter your bank account number'); point('acNumberE');}
			else if(!isCheck('ifscE')){toast('tst_danger','Please enter your bank ifsc code'); point('ifscE');}
			else if(!isCheck('brNameE')){toast('tst_danger','Please enter your bank branch'); point('brNameE');}
			else{
				    $('#bnkInf').html('<button class="edtBtn btnIncR"><i class="bx bx-cog bx-spin"></i> Wait...</button>');
					$.post(isCheckUrl,{bName:isCheck('bNameE'),acNumber:isCheck('acNumberE'),ifsc:isCheck('ifscE'),brName:isCheck('brNameE'),actn:'bnkInfo'},
					function(html){	toast(html.class,html.text);
					if(html.class=='tst_success')
					{
						$('#bName').html($('#bNameE').val());$('#acNumber').html($('#acNumberE').val());$('#ifsc').html($('#ifscE').val());$('#brName').html($('#brNameE').val());
						$('#bnkInf').html('<button class="edtBtn btnIncR" onclick="proManage(2,'+msg+')"><i class="mdi mdi-comment-edit-outline"></i> Edit</button>');
					   }
						 },'json');
			   }
			}
		else if(str=='2')
		{
		 	msg="'bankingInfor'";
			$('#bName').html(gethtmlTools('bNameE',$('#bName').text()));$('#bNameE').css('width','60%');
			$('#acNumber').html(gethtmlTools('acNumberE',$('#acNumber').text()));$('#acNumberE').css('width','55%');
			
			$('#ifsc').html(gethtmlTools('ifscE',$('#ifsc').text()));$('#ifscE').css('width','60%');
			$('#brName').html(gethtmlTools('brNameE',$('#brName').text()));$('#brNameE').css('width','55%');
			$('#bnkInf').html('<button class="updtBtn btnIncR" onclick="proManage(1,'+msg+')"><i class="mdi mdi-comment-edit-outline"></i> Update</button>');
		  }
		}
	else if(actn=='nomineeInfor')
	{
		let msg='';$('#nomineeInf').html('<button class="edtBtn btnIncR"><i class="bx bx-cog bx-spin"></i> Wait...</button>');
		if(str=='1')
		{
			msg="'nomineeInfor'";
			if(!isCheck('nomineeNameE')){toast('tst_danger','Please enter your nominee name'); point('nomineeNameE');}
			else if(!isCheck('nomineeRelationE')){toast('tst_danger','Please enter your nominee relationship'); point('nomineeRelationE');}
			else if(!isCheck('nomineeAddrE')){toast('tst_danger','Please enter your nominee address'); point('nomineeAddrE');}
			else
			{
				$.post(isCheckUrl,{nomineeName:isCheck('nomineeNameE'),nomineeRelation:isCheck('nomineeRelationE'),nomineeAddr:isCheck('nomineeAddrE'),actn:'nomineeInfo'},
				function(html){toast(html.class,html.text);
				if(html.class=='tst_success')
				{$('#nomineeName').html($('#nomineeNameE').val());$('#nomineeRelation').html($('#nomineeRelationE').val());$('#nomineeAddr').html($('#nomineeAddrE').val());
					$('#nomineeInf').html('<button class="edtBtn btnIncR" onclick="proManage(2,'+msg+')"><i class="mdi mdi-comment-edit-outline"></i> Edit</button>');
				   }
					 },'json');
			  }
			}
		else if(str=='2')
		{
		 	msg="'nomineeInfor'";
			$('#nomineeName').html(gethtmlTools('nomineeNameE',$('#nomineeName').text()));$('#nomineeNameE').css('width','60%');
			$('#nomineeRelation').html(gethtmlTools('nomineeRelationE',$('#nomineeRelation').text()));$('#nomineeRelationE').css('width','55%');
			$('#nomineeAddr').html(gethtmlTools('nomineeAddrE',$('#nomineeAddr').text()));$('#ifscE').css('width','60%');
			$('#nomineeInf').html('<button class="updtBtn btnIncR" onclick="proManage(1,'+msg+')"><i class="mdi mdi-comment-edit-outline"></i> Update</button>');
		  }
		
		}
		
	
}
