function delSaleTempKart(str)
{
	let actnVal=str.split('@@@@');
	$('#saleMsg').html('Delete Sale Product');
	$('#delSaleData').html('Are you sure want to delete '+actnVal[1]).css('color','#f46a6a');
	$('#cnfSaleDel_id').val('delTempSaleProduct-member/order/manage-'+actnVal[0]);
	$('#deleteSaleModel').modal('show'); 
	}	


function camSaleByFrenchise(str)
{
  let isCheckUrl=isCheck('base_url')+'member/order/kart_by_frenchise_to_member';
  $.post(isCheckUrl,{proId:str,slrID:isCheck('slrID'),sellerType:isCheck('sellerType')},function(getData)
  {
	  //$('#myResultShow').html(getData).show();
	  $('#mrp').html('<i class="bx bx-rupee inrP"></i> '+getData.mrp);$('#proID').val(getData.id); $('#soldBy').val(getData.soldBy);
	  $('#p_price').html('<i class="bx bx-rupee inrP"></i> '+getData.product_price);$('#proNameByShop').val(getData.product_name);$('#proList').hide();
      $('#tDiscount').html(getData.discount+' <i class="mdi mdi-percent-outline inrP"></i>');$('#avlPrQty').val(getData.quantity); $('#bv').html(getData.productBV);
	  $('#tTax').html(getData.productTax+' <i class="mdi mdi-percent-outline inrR"></i>');
      if(isCheck('proQty'))
      {let tAmt=$('#p_price').text()*$('#proQty').val();let discount=$('#tDiscount').text().split(" ");let netAmt=tAmt-(discount[0]*tAmt)/100;
	$('#tAmt').html('<i class="bx bx-rupee inrP"></i> '+tAmt.toFixed(2));$('#tProPrice').html('<i class="bx bx-rupee inrP"></i> '+netAmt.toFixed(2));}else{$('#tAmt').html('-----');			    $('#tProPrice').html('-----'); }$('#proQty').focus();
   },'json');	  
  
}
function addTempKart()
{
	if(isCheck('soldBy')=='spAdmn'){if(!isCheck('proName')){toast('tst_danger','Please input product name'); point('proName');}}	
	else if(!isCheck('proQty')){toast('tst_danger','Please input product quantity'); point('proQty');}
	else
	{
		let isCheckUrl=isCheck('base_url')+'member/order/addTempKart';let pQty=isCheck('proQty');
		$.post(isCheckUrl,{proID:isCheck('proID'),proQty:isCheck('proQty'),slrID:isCheck('slrID'),sellerType:isCheck('sellerType')},function(getData)
		{$("#data_not_found").remove();$("#miWidth").css('width','84.5%');$("#proName").val('');
		$("#mrp,#p_price,#tAmt,#tDiscount,#tProPrice,#bv,#tTax").html('<div style="color:#058ba8;margin-top: 10px;">----</div>');
		$("#miKrtBtn").css('margin-top','-10px');$("#proNameByShop").val('');$("#proQty").val('');
		if(getData.miResult=='success')
		{toast(getData.adClass,getData.msg);$('#tempKartTble tbody').append(getData.text);$("#grantTotalAmt").html(getData.grndT);}
		else if(getData.miResult=='miRowUpdate')
		{toast(getData.adClass,getData.msg); $("#pQty--"+getData.rowUpdate).html(getData.text.qty);$("#tAmt--"+getData.rowUpdate).html(getData.text.tAmt);
			$("#netAmt--"+getData.rowUpdate).html(getData.text.netAmt);$("#grantTotalAmt").html(getData.grndT);;
			}
			else if(getData.miResult=='warning'){toast(getData.adClass,getData.text);}
			else if(getData.miResult=='error'){toast(getData.adClass,getData.text);$("#proQty").val(pQty);}
			
		else{toast('tst_warning',getData.text);}
		},'json');
		}
	}






